pragma solidity ^0.8.0;

import "../node_modules/@openzeppelin/contracts/token/ERC721/IERC721.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";

// Define contract
contract MorarableMarketContract {
    using SafeMath for uint256;

    // Define a basic auction item
    struct AuctionItem {

        // Id of the item
        uint id;

        // token address of the item
        address tokenAddress;

        // Token id of the item
        uint itemId;      

        // Address of the seller
        address seller;

        // Price of the item
        uint askingPrice;

        // If the item is sold
        bool isSold;
    }

    // balance of the contract
    uint256 ContractBalance;
    
    // balances of the users
    mapping (address => uint256) public balances;
    
    // Items in the marketplace
    AuctionItem[] public itemsForSale;

    // Mapping that keeps track if which items are already on for sale
    mapping (address => mapping (uint256 => bool)) activeItems;

    // Event fired when a new item is added to the marketplace
    event itemAdded(uint indexed id, uint itemId, address tokenAddress, uint askingPrice);

    // Event fired when an item is sold
    event itemSold(uint indexed id, address newOwner, uint price);

    // Event fired when a deposit is made
    event deposited(address userAddress, uint amount);

    // Event fired when a withdraw is made
    event withdrawl(address userAddress, uint amount);        

    // Modifier that checks so that only the owner of the given token can perform an action
    modifier OnlyItemOwner (address tokenAddress, uint id){
        IERC721 tokenContract = IERC721(tokenAddress);
        require(tokenContract.ownerOf(id) == msg.sender);
        _;        
    }

    // Modifier that checks so that the market place is allowed to trade the token on behalf of the user
    modifier HasTransferApproval (address tokenAddress, uint itemId){
        IERC721 tokenContract = IERC721(tokenAddress);
        require(tokenContract.getApproved(itemId) == address(this));
        _;        
    }
    
    // Modifier that checks so that an item exists in the market place
    modifier ItemExists (uint id){
        require(id < itemsForSale.length && itemsForSale[id].id == id, "Could not find item");    
        _;        
    }

    // Modifier that checks so that an item is not already sold
    modifier IsForSale (uint id){
        require(itemsForSale[id].isSold == false, "Item is already sold!");    
        _;        
    }

    // Function that lets the user deposit eth into the marketplace
    function deposit() payable external{
        require(msg.value > 0);
        ContractBalance += msg.value;
        balances[msg.sender] += msg.value;
        emit deposited(msg.sender, msg.value);
        assert(ContractBalance == address(this).balance);
    }

    function withdraw(uint amount) external{
        require(balances[msg.sender] >= amount, "Balance not sufficient");    
        ContractBalance = ContractBalance.sub(amount);
        balances[msg.sender] = balances[msg.sender].sub(amount);
        payable(msg.sender).transfer(amount);
        assert(ContractBalance == address(this).balance);
    }

    function addItemToMarket(uint itemId, address tokenAddress, uint askingPrice) OnlyItemOwner(tokenAddress, itemId) HasTransferApproval(tokenAddress, itemId) external returns (uint256) {    
        uint256 newItemId = itemsForSale.length;
        itemsForSale.push(AuctionItem(newItemId,tokenAddress, itemId, msg.sender, askingPrice, false));    
        activeItems[tokenAddress][itemId] = true;
        assert(itemsForSale[newItemId].id == newItemId);
        emit itemAdded(newItemId, itemId,tokenAddress, askingPrice);
        return newItemId;
    }

    function buyItem(uint id) external ItemExists(id) IsForSale(id) HasTransferApproval(itemsForSale[id].tokenAddress, itemsForSale[id].itemId) {   
        require(balances[msg.sender] >= itemsForSale[id].askingPrice, "Not enough balance!");

        balances[msg.sender] = balances[msg.sender].sub(itemsForSale[id].askingPrice);
        balances[itemsForSale[id].seller] = balances[itemsForSale[id].seller].add(itemsForSale[id].askingPrice);
        itemsForSale[id].isSold = true;
        activeItems[itemsForSale[id].tokenAddress][itemsForSale[id].itemId] = false;
        IERC721(itemsForSale[id].tokenAddress).safeTransferFrom(itemsForSale[id].seller, msg.sender, itemsForSale[id].itemId);
        emit itemSold(id, msg.sender, itemsForSale[id].askingPrice);
    }  
}
